import React from 'react';
import './styles.css';
import FormTextBox from './FormTextBox';
import SubmitButton from './SubmitButton';
import { Title, Text, TextInput } from 'react-native-paper';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

class Register extends React.Component{

    state = {
        email: '',
        username: '',
        password: '',
        confirmPass: ''
    }

    render() {
        return(
            <div className="fullpage">
                <Container className="main">
                    <Row>
                        <Col md={{span:4, offset:4}}>
                            <Title>Register!</Title>
                            <TextInput value={this.state.email} label='email' onKeyPress={this.setState({email})}/>
                            <TextInput value={this.state.username} label='username' onKeyPress={this.setState({username})}/>
                            <TextInput value={this.state.password} label='password' onKeyPress={this.setState({password})}/>
                            <TextInput value={this.state.confirmPass} label='confirm password' onKeyPress={this.setState({confirmPass})}/>
                            <SubmitButton />
                            <Text>Already have an account?</Text>
                            <a href="">Login</a>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Register;
